import Layout from '../components/MyLayout';

const Index = props => (
    <Layout>
        <h3>PROFIL MAHASISWA STIKOM PGRI BANYUWANGI</h3>
        <h4>Nama : Fachriz Monica<br/>
        Tempat,Tgl Lahir : Banyuwangi, 22 September 1998<br/>
        Alamat : Pakis<br/>
        Pekerjaan : Mahasiswa/ wirausaha<br/>
        Hobi : Membaca<br/>
        NIM : 1118101668<br/>
        JURUSAN : S1 TEKNIK INFORMATIKA - MALAM 2018
        </h4>
    </Layout>
);

export default Index;
